        int balance = 0;

        for (char ch : paren_string.toCharArray()) {
            if (ch == ' ') {
                continue; // Ignore spaces
            }
            currentGroup.append(ch); // Add current character to the group
            if (ch == '(') {
                balance++; // Increment for opening parenthesis
            } else if (ch == ')') {
                balance--; // Decrement for closing parenthesis
            }
            // If balance is zero, we have a complete group
            if (balance == 0) {
                result.add(currentGroup.toString()); // Add the complete group to the result
                currentGroup.setLength(0); // Reset the current group
            }
        }
        return result;
    }
}

