        if (substring.isEmpty() || string.length() < substring.length()) {
            return 0; // If substring is empty or longer than the string, return 0
        }

        int count = 0;
        int substringLength = substring.length();

        for (int i = 0; i <= string.length() - substringLength; i++) {
            // Check if the substring matches the current position
            if (string.substring(i, i + substringLength).equals(substring)) {
                count++; // Increment count for each match
            }
        }

        return count; // Return the total count of occurrences
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.how_many_times("", "x") == 0,
                s.how_many_times("xyxyxyx", "x") == 4,
                s.how_many_times("cacacacac", "cac") == 4,
                s.how_many_times("john doe", "john") == 1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

