class Solution {
    public List<Integer> parse_music(String string) {
        List<Integer> beats = new ArrayList<>();
        String[] notes = string.split(" "); // Split the input string by spaces

        for (String note : notes) {
            switch (note) {
                case "o":
                    beats.add(4); // Whole note
                    break;
                case "o|":
                    beats.add(2); // Half note
                    break;
                case ".|":
                    beats.add(1); // Quarter note
                    break;
                default:
                    // Handle unexpected input if necessary
                    break;
            }
        }

        return beats; // Return the list of beats
    }
}

