class Solution {
    public String sort_numbers(String numbers) {
        // Step 1: Create a mapping from words to numbers
        Map<String, Integer> wordToNumber = new HashMap<>();
        wordToNumber.put("zero", 0);
        wordToNumber.put("one", 1);
        wordToNumber.put("two", 2);
        wordToNumber.put("three", 3);
        wordToNumber.put("four", 4);
        wordToNumber.put("five", 5);
        wordToNumber.put("six", 6);
        wordToNumber.put("seven", 7);
        wordToNumber.put("eight", 8);
        wordToNumber.put("nine", 9);

        // Step 2: Split the input string into an array of words
        String[] words = numbers.split(" ");

        // Step 3: Convert each word to its corresponding integer
        Integer[] numbersArray = new Integer[words.length];
        for (int i = 0; i < words.length; i++) {
            numbersArray[i] = wordToNumber.get(words[i]);
        }

        // Step 4: Sort the array of integers
        Arrays.sort(numbersArray);

        // Step 5: Convert the sorted integers back to their corresponding words
        String[] sortedWords = new String[numbersArray.length];
        for (int i = 0; i < numbersArray.length; i++) {
            for (Map.Entry<String, Integer> entry : wordToNumber.entrySet()) {
                if (entry.getValue().equals(numbersArray[i])) {
                    sortedWords[i] = entry.getKey();
                    break;
                }
            }
        }

        // Step 6: Join the words into a single string with spaces
        return String.join(" ", sortedWords);
    }
}

