class Solution {
    public String sort_numbers(String numbers) {
        // Mapping from words to their corresponding numeric values
        Map<String, Integer> wordToNum = new HashMap<>();
        wordToNum.put("zero", 0);
        wordToNum.put("one", 1);
        wordToNum.put("two", 2);
        wordToNum.put("three", 3);
        wordToNum.put("four", 4);
        wordToNum.put("five", 5);
        wordToNum.put("six", 6);
        wordToNum.put("seven", 7);
        wordToNum.put("eight", 8);
        wordToNum.put("nine", 9);

        // Reverse mapping from numeric values to words
        String[] numToWord = new String[10];
        for (Map.Entry<String, Integer> entry : wordToNum.entrySet()) {
            numToWord[entry.getValue()] = entry.getKey();
        }

        // Split the input string into words
        String[] words = numbers.split(" ");

        // Convert words to their corresponding numeric values
        Integer[] nums = new Integer[words.length];
        for (int i = 0; i < words.length; i++) {
            nums[i] = wordToNum.get(words[i]);
        }

        // Sort the numeric values
        Arrays.sort(nums);

        // Convert sorted numeric values back to words
        StringBuilder sortedWords = new StringBuilder();
        for (int num : nums) {
            sortedWords.append(numToWord[num]).append(" ");
        }

        // Remove the trailing space and return the result
        return sortedWords.toString().trim();
    }
}

