class Solution {
    public List<Integer> factorize(int n) {
        List<Integer> factors = new ArrayList<>();
        // Start with the smallest prime number
        int prime = 2;

        // Continue until n becomes 1
        while (n > 1) {
            // While n is divisible by the current prime
            while (n % prime == 0) {
                factors.add(prime); // Add the prime factor
                n /= prime; // Divide n by the prime
            }
            prime++; // Move to the next number
            // Optimization: No need to check beyond the square root of n
            if (prime * prime > n) {
                if (n > 1) {
                    factors.add(n); // n is prime
                }
                break;
            }
        }
        return factors;
    }
}

