class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        // Sort the list of numbers
        Collections.sort(numbers);

        // Initialize variables to track the closest pair and minimum distance
        double minDistance = Double.MAX_VALUE;
        List<Double> closestPair = new ArrayList<>();

        // Iterate through the sorted list to find the closest pair
        for (int i = 0; i < numbers.size() - 1; i++) {
