class Solution {
    public List<Integer> remove_duplicates(List<Integer> numbers) {
        // Step 1: Create a HashMap to count occurrences
        Map<Integer, Integer> countMap = new HashMap<>();

        // Step 2: Count occurrences of each number
        for (Integer number : numbers) {
            countMap.put(number, countMap.getOrDefault(number, 0) + 1);
        }

        // Step 3: Create a result list to store unique elements
        List<Integer> result = new ArrayList<>();

        // Step 4: Add elements that occur exactly once to the result list
        for (Integer number : numbers) {
            if (countMap.get(number) == 1) {
                result.add(number);
            }
        }

        // Step 5: Return the result list
        return result;
    }
}

