class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double poly_derivative(List<Double> xs, double x) {
        double result = 0;
        for (int i = 1; i < xs.size(); i++) {
            result += i * xs.get(i) * Math.pow(x, i - 1);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        double x = 0.0; // Initial guess
        double tolerance = 1e-7;
        int max_iterations = 1000;

        for (int i = 0; i < max_iterations; i++) {
            double value = poly(xs, x);
            double derivative = poly_derivative(xs, x);
            if (Math.abs(value) < tolerance) {
                return x; // Found a root
            }
            if (derivative == 0) {
                break; // Avoid division by zero
            }
            x = x - value / derivative; // Newton-Raphson update
        }
        return x; // Return the last computed x
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
