        double epsilon = 1e-7; // Precision for the root finding

        // Ensure that we have a sign change in the initial interval
        while (poly(xs, lower) * poly(xs, upper) > 0) {
            lower -= 1000; // Expand the lower bound
            upper += 1000; // Expand the upper bound
        }

        // Bisection method
        while (upper - lower > epsilon) {
            double mid = (lower + upper) / 2;
            if (poly(xs, mid) == 0) {
                return mid; // Found exact zero
            } else if (poly(xs, mid) * poly(xs, lower) < 0) {
                upper = mid; // Root is in the lower half
            } else {
                lower = mid; // Root is in the upper half
            }
        }

        return (lower + upper) / 2; // Return the midpoint as the root
    }
}

