        List<Integer> result = new ArrayList<>(Collections.nCopies(l.size(), 0));
        List<Integer> collection = new ArrayList<>();

        // Collect values at indices divisible by 3
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                collection.add(l.get(i));
            } else {
                result.set(i, l.get(i));
            }
        }

        // Sort the collected values
        Collections.sort(collection);

        // Fill the result list with sorted values at the appropriate indices
        int index = 0;
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                result.set(i, collection.get(index));
                index++;
            }
        }

        return result;
    }
}

