import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.util.*;

class Solution {
    public int prime_fib(int n) {
        List<Integer> primeFibs = new ArrayList<>();
        int a = 0, b = 1; // Starting Fibonacci numbers

        while (primeFibs.size() < n) {
            int nextFib = a + b; // Generate next Fibonacci number
            a = b; // Move to the next Fibonacci number
            b = nextFib;

            if (isPrime(nextFib)) {
                primeFibs.add(nextFib); // Add to the list if it's prime
            }
        }

        return primeFibs.get(n - 1); // Return the n-th prime Fibonacci number
    }

    private boolean isPrime(int num) {
        if (num <= 1) return false; // 0 and 1 are not prime
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) return false; // Found a divisor, not prime
        }
        return true; // No divisors found, it's prime
    }
}

