                s.prime_fib(7) == 1597,
                s.prime_fib(8) == 28657,
                s.prime_fib(9) == 514229,
                s.prime_fib(10) == 433494437
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

