class Solution {
    // Function to check if a number is prime
    private boolean isPrime(int num) {
        if (num <= 1) return false;
        for (int i = 2; i * i <= num; i++) {
            if (num % i == 0) return false;
        }
        return true;
    }

    // Function to return the n-th prime Fibonacci number
    public int prime_fib(int n) {
        List<Integer> primeFibList = new ArrayList<>();
        int fib1 = 0, fib2 = 1;

        while (primeFibList.size() < n) {
            int fibNext = fib1 + fib2;
            fib1 = fib2;
            fib2 = fibNext;

            if (isPrime(fibNext)) {
                primeFibList.add(fibNext);
            }
        }
        return primeFibList.get(n - 1);
    }
}

