class Solution {
    public int fib4(int n) {
        // Handle base cases
        if (n == 0) return 0;
        if (n == 1) return 0;
        if (n == 2) return 2;
        if (n == 3) return 0;

        // Initialize the first four values
        int[] fib4 = new int[4];
        fib4[0] = 0; // fib4(0)
        fib4[1] = 0; // fib4(1)
        fib4[2] = 2; // fib4(2)
        fib4[3] = 0; // fib4(3)

        // Calculate fib4(n) iteratively
        for (int i = 4; i <= n; i++) {
            int current = fib4[0] + fib4[1] + fib4[2] + fib4[3];
            // Update the last four values
            fib4[0] = fib4[1];
            fib4[1] = fib4[2];
            fib4[2] = fib4[3];
            fib4[3] = current;
        }

        // The result for fib4(n) is in fib4[3]
        return fib4[3];
    }
}

