class Solution {
    public int modp(int n, int p) {
        if (n == 0) return 1; // 2^0 = 1
        long result = 1; // Use long to prevent overflow
        long base = 2; // Base is 2

        while (n > 0) {
            if (n % 2 == 1) { // If n is odd
                result = (result * base) % p; // Multiply and take modulo
            }
            n /= 2; // Divide n by 2
            base = (base * base) % p; // Square the base and take modulo
        }

        return (int)result; // Cast to int before returning
    }
}

