class Solution {
    public String encodeShift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            sb.append((char) ('a' + ((ch + 5 - 'a') % 26)));
        }
        return sb.toString();
    }

    public String decode_shift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (ch >= 'a' && ch <= 'z') {
                // Shift back by 5
                char decodedChar = (char) (ch - 5);
                // Wrap around if necessary
                if (decodedChar < 'a') {
                    decodedChar += 26;
                }
                sb.append(decodedChar);
            } else {
                // If the character is not in the range, append it as is
                sb.append(ch);
            }
        }
        return sb.toString();
    }
}

