            sb.append((char) ('a' + ((ch + 5 - 'a') % 26)));
        }
        return sb.toString();
    }

    /**
    takes as input string encoded with encodeShift function. Returns decoded string.
     */
    public String decode_shift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (ch >= 'a' && ch <= 'z') {
                // Shift back by 5 and handle wrap-around
                char newChar = (char) ((ch - 'a' - 5 + 26) % 26 + 'a');
                sb.append(newChar);
            } else {
                // Append non-alphabet characters unchanged
                sb.append(ch);
            }
        }
        return sb.toString();
    }
}

