class Solution {
    public int fib(int n) {
        if (n == 0) {
            return 0;
        }
        if (n == 1) {
            return 1;
        }

        int prev1 = 0; // F(0)
        int prev2 = 1; // F(1)
        int current = 0; // To hold the current Fibonacci number

        for (int i = 2; i <= n; i++) {
            current = prev1 + prev2; // F(n) = F(n-1) + F(n-2)
            prev1 = prev2; // Move prev1 to F(n-1)
            prev2 = current; // Move prev2 to F(n)
        }

        return current; // Return the n-th Fibonacci number
    }
}

