class Solution {
    public int fib(int n) {
        if (n == 0) return 0;
        if (n == 1) return 1;

        int a = 0; // F(0)
        int b = 1; // F(1)
        int next = 0;

        for (int i = 2; i <= n; i++) {
            next = a + b; // F(n) = F(n-1) + F(n-2)
            a = b; // Move to next Fibonacci number
            b = next; // Update b to the latest Fibonacci number
        }

        return b; // Return the n-th Fibonacci number
    }
}

