class Solution {
    public List<Integer> derivative(List<Integer> xs) {
        // Check if the input list is empty or has only one element
        if (xs.size() <= 1) {
            return new ArrayList<>(); // The derivative of a constant or empty polynomial is empty
        }

        List<Integer> result = new ArrayList<>();
        // Calculate the derivative coefficients
        for (int i = 1; i < xs.size(); i++) {
            result.add(xs.get(i) * i); // Coefficient of x^(i-1) is xs[i] * i
        }

        return result; // Return the list of derivative coefficients
    }
}

