class Solution {
    // Method to generate all prime numbers less than 100
    private List<Integer> generatePrimes() {
        List<Integer> primes = new ArrayList<>();
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);
        isPrime[0] = isPrime[1] = false; // 0 and 1 are not prime numbers

        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                primes.add(i);
                for (int j = i * 2; j < 100; j += i) {
                    isPrime[j] = false; // Mark multiples of i as non-prime
                }
            }
        }
        return primes;
    }

    public boolean is_multiply_prime(int a) {
        List<Integer> primes = generatePrimes();
        int size = primes.size();

        // Check all combinations of three primes
        for (int i = 0; i < size; i++) {
            for (int j = i; j < size; j++) {
                for (int k = j; k < size; k++) {
                    int product = primes.get(i) * primes.get(j) * primes.get(k);
                    if (product == a) {
                        return true; // Found a combination that multiplies to a
                    }
                }
            }
        }
        return false; // No combination found
    }
}

