class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Calculate the sum of the list
        int sum = 0;
        for (int num : q) {
            sum += num;
        }

        // Check if the list is palindromic
        int left = 0;
        int right = q.size() - 1;
        while (left < right) {
            if (!q.get(left).equals(q.get(right))) {
                return false; // Not palindromic
            }
            left++;
            right--;
        }

        // Check the conditions
        return sum <= w; // Return true if balanced and within weight
    }
}

