class Solution {
    public String anti_shuffle(String s) {
        // Split the string by spaces while keeping the spaces
        String[] words = s.split("(?<=\\s)|(?=\\s)");
        StringBuilder result = new StringBuilder();

        for (String word : words) {
            if (!word.trim().isEmpty()) { // Check if the word is not just spaces
                char[] charArray = word.toCharArray();
                Arrays.sort(charArray); // Sort the characters
                result.append(new String(charArray)); // Append sorted characters
            } else {
                result.append(word); // Append the space as is
            }
        }

        return result.toString(); // Return the final ordered string
    }
}

