                s.any_int(2, 6, 2) == false,
                s.any_int(4, 2, 2) == true,
                s.any_int(2.2, 2.2, 2.2) == false,
                s.any_int(-4, 6, 2) == true,
                s.any_int(2, 1, 1) == true,
                s.any_int(3, 4, 7) == true,
                s.any_int(3.0, 4, 7) == false
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

