class Solution {
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> coordinates = new ArrayList<>();

        // Iterate through each row
        for (int i = 0; i < lst.size(); i++) {
            List<Integer> row = lst.get(i);
            // Iterate through each column in the row
            for (int j = 0; j < row.size(); j++) {
                if (row.get(j) == x) {
                    // Add the coordinates to the list
                    coordinates.add(Arrays.asList(i, j));
                }
            }
        }

        // Sort the coordinates
        Collections.sort(coordinates, new Comparator<List<Integer>>() {
            public int compare(List<Integer> a, List<Integer> b) {
                // First compare by row index (ascending)
                if (!a.get(0).equals(b.get(0))) {
                    return a.get(0) - b.get(0);
                }
                // Then compare by column index (descending)
                return b.get(1) - a.get(1);
            }
        });

        return coordinates;
    }
}

