class Solution {
    public int closest_integer(String value) {
        double number = Double.parseDouble(value);

        // Check if the number is already an integer
        if (number == Math.floor(number)) {
            return (int) number; // Return as integer
        }

        // Get the lower and upper integers
        int lower = (int) Math.floor(number);
        int upper = (int) Math.ceil(number);

        // Calculate distances
        double distanceToLower = Math.abs(number - lower);
        double distanceToUpper = Math.abs(number - upper);

        // If distances are equal, round away from zero
        if (distanceToLower == distanceToUpper) {
            if (number > 0) {
                return upper; // Round up for positive numbers
            } else {
                return lower; // Round down for negative numbers
            }
        }

        // Return the closest integer
        return distanceToLower < distanceToUpper ? lower : upper;
    }
}

