class Solution {
    public List<Integer> count_up_to(int n) {
        List<Integer> primes = new ArrayList<>();
        if (n <= 1) {
            return primes; // Return empty list for n <= 1
        }

        for (int i = 2; i < n; i++) {
            if (isPrime(i)) {
                primes.add(i);
            }
        }

        return primes;
    }

    private boolean isPrime(int x) {
        if (x <= 1) {
            return false; // 0 and 1 are not prime
        }
        for (int j = 2; j * j <= x; j++) { // Check up to the square root of x
            if (x % j == 0) {
                return false; // x is divisible by j, hence not prime
            }
        }
        return true; // x is prime
    }
