class Solution {
    public List<Integer> count_up_to(int n) {
        List<Integer> primes = new ArrayList<>();

        // Check for numbers less than 2, which are not prime
        if (n < 2) {
            return primes; // Return empty list
        }

        // Loop through numbers from 2 to n-1
        for (int num = 2; num < n; num++) {
            boolean isPrime = true;
            // Check if num is prime
            for (int i = 2; i <= Math.sqrt(num); i++) {
                if (num % i == 0) {
                    isPrime = false; // num is divisible by i, hence not prime
                    break;
                }
            }
            // If num is prime, add it to the list
            if (isPrime) {
                primes.add(num);
            }
        }

        return primes; // Return the list of prime numbers
    }
}

