class Solution {
    public List<Integer> count_up_to(int n) {
        List<Integer> primes = new ArrayList<>();
        if (n < 2) {
            return primes; // Return empty list if n is less than 2
        }

        for (int i = 2; i < n; i++) {
            if (isPrime(i)) {
                primes.add(i);
            }
        }
        return primes;
    }

    private boolean isPrime(int num) {
        if (num <= 1) {
            return false; // 0 and 1 are not prime numbers
        }
        for (int j = 2; j * j <= num; j++) { // Check divisibility up to the square root of num
            if (num % j == 0) {
                return false; // num is divisible by j, hence not prime
            }
        }
        return true; // num is prime
    }
}

