class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        // If the array is empty, return true
        if (arr.isEmpty()) {
            return true;
        }

        int dropCount = 0;
        int n = arr.size();

        // Check for drops in the array
        for (int i = 0; i < n; i++) {
            if (arr.get(i) > arr.get((i + 1) % n)) {
                dropCount++;
