        }

        int breakCount = 0;
        int n = arr.size();

        // Loop through the array to count breaks
        for (int i = 0; i < n; i++) {
            if (arr.get(i) > arr.get((i + 1) % n)) {
                breakCount++;
            }
        }

        // If there is more than one break, it's not possible to sort
        if (breakCount > 1) {
            return false;
        }

        // If there is exactly one break, check the last and first elements
        if (breakCount == 1) {
            return arr.get(n - 1) < arr.get(0);
        }

        // If there are no breaks, the array is already sorted
        return true;
    }
}

