        for (int number : arr) {
            if (sum_of_digits(number) > 0) {
                count++;
            }
        }
        return count;
    }

    private int sum_of_digits(int number) {
        int sum = 0;
        boolean isNegative = number < 0;
        number = Math.abs(number); // Work with the absolute value

        // Convert number to string to iterate over digits
        String numStr = Integer.toString(number);
        for (int i = 0; i < numStr.length(); i++) {
            int digit = Character.getNumericValue(numStr.charAt(i));
            if (i == 0 && isNegative) {
                sum -= digit; // First digit is negative
            } else {
                sum += digit; // Add other digits as positive
            }
        }
        return sum;
    }
}

