class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int oddCount = 0;
        int evenCount = 0;

        // Count odd numbers in lst1
        for (int num : lst1) {
            if (num % 2 != 0) {
                oddCount++;
            }
        }

        // Count even numbers in lst2
        for (int num : lst2) {
            if (num % 2 == 0) {
                evenCount++;
            }
        }

        // Check if we can replace all odd numbers in lst1 with even numbers from lst2
        if (oddCount <= evenCount) {
            return "YES";
        } else {
            return "NO";
        }
    }
}

