class Solution {
    public int minSubArraySum(List<Integer> nums) {
        int min_sum = Integer.MAX_VALUE; // Initialize min_sum to a large value

        // Iterate through each starting point of the sub-array
        for (int i = 0; i < nums.size(); i++) {
            int current_sum = 0; // Reset current_sum for each starting point

            // Iterate through each ending point of the sub-array
            for (int j = i; j < nums.size(); j++) {
                current_sum += nums.get(j); // Add the current element to the sum

                // Update min_sum if the current_sum is smaller
                if (current_sum < min_sum) {
                    min_sum = current_sum;
                }
            }
        }

        return min_sum; // Return the minimum sum found
    }
}

