class Solution {
    public List<Object> reverse_delete(String s, String c) {
        // Create a set of characters to be deleted for quick lookup
        Set<Character> charsToDelete = new HashSet<>();
        for (char ch : c.toCharArray()) {
            charsToDelete.add(ch);
        }

        // Build the result string by excluding characters in c
        StringBuilder result = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (!charsToDelete.contains(ch)) {
                result.append(ch);
            }
        }

        // Check if the result string is a palindrome
        String resultString = result.toString();
        boolean isPalindrome = resultString.equals(result.reverse().toString());

        // Prepare the output as a list
        List<Object> output = new ArrayList<>();
        output.add(resultString);
        output.add(isPalindrome);

        return output;
    }
}

