class Solution {
    public String get_closest_vowel(String word) {
        Set<Character> vowels = new HashSet<>(Arrays.asList('a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U'));
        int length = word.length();

        // If the word is too short to have consonant-vowel-consonant pattern
        if (length < 3) {
            return "";
        }

        // Iterate from the end of the word
        for (int i = length - 1; i > 0; i--) {
            char currentChar = word.charAt(i);
            // Check if current character is a consonant
            if (!vowels.contains(currentChar)) {
                // Look for a vowel before this consonant
                for (int j = i - 1; j >= 0; j--) {
                    char prevChar = word.charAt(j);
                    // Check if the previous character is a vowel
                    if (vowels.contains(prevChar)) {
                        // Check if there is a consonant before the vowel
                        if (j - 1 >= 0 && !vowels.contains(word.charAt(j - 1))) {
                            return String.valueOf(prevChar);
                        }
                    }
                    // If we hit another consonant, break the inner loop
                    if (!vowels.contains(prevChar)) {
                        break;
                    }
                }
            }
        }
        return ""; // Return empty string if no valid vowel is found
    }
}

