import java.util.*;
import java.lang.*;
import java.util.*;

class Solution {
    public List<String> select_words(String s, int n) {
        // Check if the input string is empty
        if (s.isEmpty()) {
            return new ArrayList<>();
        }

        // Define a set of vowels for easy checking
        Set<Character> vowels = new HashSet<>(Arrays.asList('a', 'e', 'i', 'o', 'u', 
                                                              'A', 'E', 'I', 'O', 'U'));
        // Split the string into words
        String[] words = s.split(" ");
        List<String> result = new ArrayList<>();

        // Iterate through each word
        for (String word : words) {
            int consonantCount = 0;

            // Count consonants in the word
            for (char c : word.toCharArray()) {
                if (Character.isLetter(c) && !vowels.contains(c)) {
                    consonantCount++;
                }
            }

            // Check if the consonant count matches n
            if (consonantCount == n) {
                result.add(word);
            }
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.select_words("Mary had a little lamb", 4).equals(List.of("little" )),
                s.select_words("Mary had a little lamb", 3).equals(Arrays.asList("Mary", "lamb")),
                s.select_words("simple white space", 2).equals(List.of()),
                s.select_words("Hello world", 4).equals(List.of("world" )),
                s.select_words("Uncle sam", 3).equals(List.of("Uncle" )),
                s.select_words("", 4).equals(List.of()),
                s.select_words("a b c d e f", 1).equals(Arrays.asList("b", "c", "d", "f"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

