class Solution {
    public List<Integer> sort_array(List<Integer> arr) {
        Collections.sort(arr, new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                // First compare by the number of 1s in binary representation
                int countA = Integer.bitCount(a);
                int countB = Integer.bitCount(b);

                if (countA != countB) {
                    return Integer.compare(countA, countB);
                } else {
                    // If counts are equal, compare by the integer value
                    return Integer.compare(a, b);
                }
            }
        });
        return arr;
    }
}

