class Solution {
    public List<Integer> maximum(List<Integer> arr, int k) {
        // Create a min-heap (priority queue)
        PriorityQueue<Integer> minHeap = new PriorityQueue<>();

        // Iterate through the array
        for (int num : arr) {
            // Add the number to the heap if we have less than k elements
            if (minHeap.size() < k) {
                minHeap.offer(num);
            } else if (num > minHeap.peek()) {
                // If the heap is full and the current number is larger than the smallest in the heap
                minHeap.poll(); // Remove the smallest
                minHeap.offer(num); // Add the current number
            }
        }

        // Convert the heap to a list
        List<Integer> result = new ArrayList<>(minHeap);

        // Sort the result in ascending order
        Collections.sort(result);

        return result;
    }
}

