class Solution {
    public List<Integer> get_odd_collatz(int n) {
        List<Integer> oddNumbers = new ArrayList<>();
        int current = n;

        while (current >= 1) {
            if (current % 2 != 0) { // Check if current is odd
                oddNumbers.add(current);
            }
            // Apply the Collatz rules
            if (current == 1) {
                break; // Stop when we reach 1
            } else if (current % 2 == 0) {
                current /= 2; // Even case
            } else {
                current = 3 * current + 1; // Odd case
            }
        }

        Collections.sort(oddNumbers); // Sort the list of odd numbers
        return oddNumbers; // Return the sorted list
    }
}

