class Solution {
    public String match_parens(List<String> lst) {
        String s1 = lst.get(0);
        String s2 = lst.get(1);

        int countOpenS1 = 0, countCloseS1 = 0;
        int countOpenS2 = 0, countCloseS2 = 0;

        // Count parentheses in s1
        for (char c : s1.toCharArray()) {
            if (c == '(') countOpenS1++;
            else countCloseS1++;
        }

        // Count parentheses in s2
        for (char c : s2.toCharArray()) {
            if (c == '(') countOpenS2++;
            else countCloseS2++;
        }

        // Check s1 + s2
        if (countOpenS1 + countOpenS2 >= countCloseS1 + countCloseS2) {
            int balance = 0;
            String combined1 = s1 + s2;
            for (char c : combined1.toCharArray()) {
                if (c == '(') balance++;
                else balance--;
                if (balance < 0) break;
            }
            if (balance == 0) return "Yes";
        }

        // Check s2 + s1
        if (countOpenS2 + countOpenS1 >= countCloseS2 + countCloseS1) {
            int balance = 0;
            String combined2 = s2 + s1;
            for (char c : combined2.toCharArray()) {
                if (c == '(') balance++;
                else balance--;
                if (balance < 0) break;
            }
            if (balance == 0) return "Yes";
        }

        return "No";
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.match_parens(Arrays.asList("()(", ")")).equals("Yes"),
                s.match_parens(Arrays.asList(")", ")")).equals("No"),
                s.match_parens(Arrays.asList("(()(())", "())())")).equals("No"),
                s.match_parens(Arrays.asList(")())", "(()()(")).equals("Yes"),
                s.match_parens(Arrays.asList("(())))", "(()())((")).equals("Yes"),
                s.match_parens(Arrays.asList("()", "())")).equals("No"),
                s.match_parens(Arrays.asList("(()(", "()))()")).equals("Yes"),
                s.match_parens(Arrays.asList("((((", "((())")).equals("No"),
                s.match_parens(Arrays.asList(")(()", "(()(")).equals("No"),
                s.match_parens(Arrays.asList(")(", ")(")).equals("No")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

