class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        List<Integer> minPath = new ArrayList<>();
        List<Integer> currentPath = new ArrayList<>();

        // Directions for moving in the grid (up, down, left, right)
        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

        // DFS function to explore paths
        void dfs(int x, int y) {
            // If we have reached the required length of k
            if (currentPath.size() == k) {
                if (minPath.isEmpty() || isLessThan(currentPath, minPath)) {
                    minPath = new ArrayList<>(currentPath);
                }
                return;
            }

            // Add current cell to the path
            currentPath.add(grid.get(x).get(y));

            // Explore neighbors
            for (int[] dir : directions) {
                int newX = x + dir[0];
                int newY = y + dir[1];
                // Check bounds
                if (newX >= 0 && newX < n && newY >= 0 && newY < n) {
                    dfs(newX, newY);
                }
            }

            // Backtrack
            currentPath.remove(currentPath.size() - 1);
        }

        // Compare two paths lexicographically
        boolean isLessThan(List<Integer> pathA, List<Integer> pathB) {
            for (int i = 0; i < pathA.size(); i++) {
                if (pathA.get(i) < pathB.get(i)) return true;
                if (pathA.get(i) > pathB.get(i)) return false;
            }
            return false; // They are equal
        }

        // Start DFS from each cell in the grid
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                dfs(i, j);
            }
        }

        return minPath;
    }
}

