class Solution {
    public String fix_spaces(String text) {
        StringBuilder result = new StringBuilder();
        int spaceCount = 0;

        for (int i = 0; i < text.length(); i++) {
            char currentChar = text.charAt(i);
            if (currentChar == ' ') {
                spaceCount++;
            } else {
                // Handle spaces before the current character
                if (spaceCount > 0) {
                    if (spaceCount > 2) {
                        result.append('-');
                    } else {
                        result.append('_');
                    }
                    spaceCount = 0; // Reset space count
                }
                result.append(currentChar); // Append the non-space character
            }
        }

        // Handle any trailing spaces
        if (spaceCount > 0) {
            if (spaceCount > 2) {
                result.append('-');
            } else {
                result.append('_');
            }
        }

        return result.toString();
    }
}

