class Solution {
    public boolean simplify(String x, String n) {
        // Split the fractions into numerator and denominator
        String[] xParts = x.split("/");
        String[] nParts = n.split("/");

        // Parse the numerators and denominators as integers
        int xNumerator = Integer.parseInt(xParts[0]);
        int xDenominator = Integer.parseInt(xParts[1]);
        int nNumerator = Integer.parseInt(nParts[0]);
        int nDenominator = Integer.parseInt(nParts[1]);

        // Calculate the products
        int numeratorProduct = xNumerator * nNumerator;
        int denominatorProduct = xDenominator * nDenominator;

        // Check if the product of the numerators is divisible by the product of the denominators
        return numeratorProduct % denominatorProduct == 0;
    }
}

