class Solution {
    public int get_max_triples(int n) {
        int[] a = new int[n];
        for (int i = 1; i <= n; i++) {
            a[i - 1] = i * i - i + 1; // Fill the array a
        }

        int[] countRemainders = new int[3]; // To count remainders 0, 1, 2
        for (int value : a) {
            int remainder = value % 3;
            countRemainders[remainder]++;
        }

        int count = 0;

        // Case 1: All three numbers have remainder 0
        count += combination(countRemainders[0], 3);
        // Case 2: All three numbers have remainder 1
        count += combination(countRemainders[1], 3);
        // Case 3: All three numbers have remainder 2
        count += combination(countRemainders[2], 3);
        // Case 4: One number from each remainder
        count += countRemainders[0] * countRemainders[1] * countRemainders[2];

        return count;
    }

    // Helper function to calculate n choose k
    private int combination(int n, int k) {
        if (n < k) return 0;
        if (k == 0) return 1;
        int result = 1;
        for (int i = 0; i < k; i++) {
            result *= (n - i);
            result /= (i + 1);
        }
        return result;
    }
}

