class Solution {
    public List<String> bf(String planet1, String planet2) {
        // List of planets in order from the Sun
        List<String> planets = Arrays.asList("Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune");

        // Check if both planets are valid
        if (!planets.contains(planet1) || !planets.contains(planet2)) {
            return new ArrayList<>(); // Return empty list if invalid
        }

        // Get the indices of the planets
        int index1 = planets.indexOf(planet1);
        int index2 = planets.indexOf(planet2);

        // Ensure index1 is less than index2 for easier range extraction
        if (index1 > index2) {
            int temp = index1;
            index1 = index2;
            index2 = temp;
        }

        // Extract the sublist of planets between the two indices
        return planets.subList(index1 + 1, index2);
    }
}

