class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        if (nums.isEmpty()) {
            return new ArrayList<>();
        }

        // Custom comparator to sort based on the sum of digits
        Collections.sort(nums, (a, b) -> {
            int sumA = digitSum(a);
            int sumB = digitSum(b);
            // Compare the sums of digits
            if (sumA != sumB) {
                return Integer.compare(sumA, sumB);
            }
            // If sums are equal, maintain original order (stable sort)
            return 0; // This ensures stability
        });

        return nums;
    }

    // Helper function to calculate the sum of digits
    private int digitSum(int num) {
        int sum = 0;
        boolean isNegative = num < 0;
        num = Math.abs(num); // Work with absolute value for digit sum

        while (num > 0) {
            sum += num % 10; // Add the last digit
            num /= 10; // Remove the last digit
        }

        // If the number was negative, subtract twice the first digit
        if (isNegative) {
            sum = -sum; // This will ensure the first digit is treated as negative
        }

        return sum;
    }
}

