class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        // Helper function to calculate the sum of digits
        Comparator<int[]> comparator = (a, b) -> {
            int sumA = digitSum(a[1]);
            int sumB = digitSum(b[1]);
            if (sumA != sumB) {
                return Integer.compare(sumA, sumB);
            }
            return Integer.compare(a[0], b[0]); // Maintain original order if sums are equal
        };

        List<int[]> indexedNums = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            indexedNums.add(new int[]{i, nums.get(i)});
        }

        Collections.sort(indexedNums, comparator);

        List<Integer> sortedNums = new ArrayList<>();
        for (int[] pair : indexedNums) {
            sortedNums.add(pair[1]);
        }

        return sortedNums;
    }

    private int digitSum(int num) {
        int sum = 0;
        boolean isNegative = num < 0;
        num = Math.abs(num);

        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }

        if (isNegative) {
            sum -= 2 * (Math.abs(num) / (int)Math.pow(10, String.valueOf(num).length() - 1));
        }

        return sum;
    }
}

