class Solution {
    public boolean cycpattern_check(String a, String b) {
        // If b is longer than a, it cannot be a substring or its rotation
        if (b.length() > a.length()) {
            return false;
        }

        // Create the concatenated version of b
        String concatenated_b = b + b;

        // Check if a contains any rotation of b
        return concatenated_b.contains(a);
    }
}

