class Solution {
    public List<Integer> eat(int number, int need, int remaining) {
        // Calculate the total eaten carrots after the meal
        int totalEaten = number;

        // Check if there are enough remaining carrots to satisfy the need
        if (remaining >= need) {
            totalEaten += need; // Eat the needed amount
            remaining -= need;  // Decrease the remaining carrots
        } else {
            totalEaten += remaining; // Eat all remaining carrots
            remaining = 0; // No carrots left
        }

        // Return the result as a list
        return Arrays.asList(totalEaten, remaining);
    }
}

