class Solution {
    public boolean right_angle_triangle(int a, int b, int c) {
        // Identify the longest side
        int maxSide = Math.max(a, Math.max(b, c));
        int side1, side2;

        // Assign the other two sides
        if (maxSide == a) {
            side1 = b;
            side2 = c;
        } else if (maxSide == b) {
            side1 = a;
            side2 = c;
        } else {
            side1 = a;
            side2 = b;
        }

        // Check the Pythagorean theorem
        return (side1 * side1 + side2 * side2 == maxSide * maxSide);
    }
}

