class Solution {
    public int do_algebra(List<String> operator, List<Integer> operand) {
        // Step 1: Handle exponentiation and multiplication/division first
        int currentResult = operand.get(0);

        for (int i = 0; i < operator.size(); i++) {
            String op = operator.get(i);
            int nextOperand = operand.get(i + 1);

            if (op.equals("**")) {
                currentResult = (int) Math.pow(currentResult, nextOperand);
            } else if (op.equals("*")) {
                currentResult *= nextOperand;
            } else if (op.equals("/")) {
                currentResult /= nextOperand; // Assuming no division by zero
            } else {
                // For addition and subtraction, we store the result and prepare for the next operation
                if (i > 0) {
                    currentResult = (int) (currentResult + nextOperand);
                }
            }
        }

        // Step 2: Handle addition and subtraction
        int finalResult = currentResult;
        for (int i = 0; i < operator.size(); i++) {
            String op = operator.get(i);
            int nextOperand = operand.get(i + 1);

            if (op.equals("+")) {
                finalResult += nextOperand;
            } else if (op.equals("-")) {
                finalResult -= nextOperand;
            }
        }

        return finalResult;
    }
}

