        // Initialize the result with the first operand
        int result = operand.get(0);

        // Create a stack to handle multiplication, division, and exponentiation
        Stack<Integer> stack = new Stack<>();
        stack.push(result);

        // Iterate through the operators and operands
        for (int i = 0; i < operator.size(); i++) {
            String op = operator.get(i);
            int num = operand.get(i + 1);

            if (op.equals("*") || op.equals("/") || op.equals("**")) {
                // Handle higher precedence operations immediately
                if (op.equals("*")) {
                    result *= num;
                } else if (op.equals("/")) {
                    result /= num; // Assuming no division by zero as per problem constraints
                } else if (op.equals("**")) {
                    result = (int) Math.pow(result, num);
                }
            } else {
                // Push the current result to stack and reset for the next operation
                stack.push(result);
                // Update result based on the current operator
                if (op.equals("+")) {
                    result = num; // Reset result to the next operand
                } else if (op.equals("-")) {
                    result = -num; // Reset result to the negative of the next operand
                }
            }
        }

        // Final evaluation of the stack for addition and subtraction
        while (!stack.isEmpty()) {
            result += stack.pop();
        }

        return result;
    }
