class Solution {
    public double mean_absolute_deviation(List<Double> numbers) {
        if (numbers.isEmpty()) {
            return 0.0; // Handle empty list case
        }

        // Step 1: Calculate the mean
        double sum = 0.0;
        for (double number : numbers) {
            sum += number;
        }
        double mean = sum / numbers.size();

        // Step 2: Calculate absolute deviations
        double totalAbsoluteDeviation = 0.0;
        for (double number : numbers) {
            totalAbsoluteDeviation += Math.abs(number - mean);
        }

        // Step 3: Calculate Mean Absolute Deviation
        double mad = totalAbsoluteDeviation / numbers.size();
        return mad;
    }
}

